import React from "react";

const Card = (props) => {
  const { country } = props;
  return (
    <li className="card">
      <img src={country.flag} alt="Drapeau" />
      <div className="data-container">
        <ul>
          <li>{country.name.common}</li>
          <li>{country.capital}</li>
          <li>{country.population}</li>
        </ul>
      </div>
    </li>
  );
};

export default Card;
